import React from "react";
import navi from "../../assets/navi-1.jpg";
import "./styles.scss";
export const Home = () => {
  return (
    <div id="home">
      <img src={navi} alt="navi" className="sidebar--img" />
      <p className="hello">Hello I'm</p>
      <p className="name">Navdeep Singh</p>
      <p>
        As a senior software engineer with a focus on front-end development, I'm
        passionate about building exceptional websites and delivering immersive
        user experiences. My skills include HTML5, CSS3, JavaScript, and React,
        along with back-end technologies such as Node.js, MongoDB, and Firebase.
        I bring a relentless focus on quality and attention to detail to every
        project, and take pride in creating elegant, intuitive solutions that
        exceed client expectations. With a love for technology and a commitment
        to excellence, I'm always exploring new web development trends and
        pushing the boundaries of what's possible. If you're looking for a
        skilled and dedicated software engineer, let's chat!
      </p>
    </div>
  );
};
